function regres(mas, long) {
    //console.log(mas);
    let n = mas.length;
    //console.log(n);
    let x = 0;
    //console.log(x);
    let y = 0;
    let x2 = 0;
    let xy = 0;

    mas.forEach(function (elem, index) {
        x += (index + 1);
        y += elem;
        x2 += (index + 1) * (index + 1);
        xy += elem * (index + 1);
    });
    //console.log(y);
    //console.log(x2);
    //console.log(xy);
    let delta = (x2 * n) - (x * x);
    //console.log(delta);
    let deltaa = (xy * n) - (x * y);
    //console.log(deltaa);
    let deltab = (x2 * y) - (xy * x);
    //console.log(deltab);
    let a = deltaa / delta;
    //console.log(a);
    let b = deltab / delta;
    //console.log(b);
    return (n + long) * a + b;

}

function sendArr(mas, len, long) {
    mas = mas.slice(mas.length - len, (mas.length));
//console.log(mas)
    return regres(mas, long);

}

